function clickArrow(e){switch(e){case"left":changeType(!1);break;case"top":getContent(!1);break;case"right":changeType(!0);break;case"bottom":getContent(!0)}}function initScrollHandler(){indicator=new WheelIndicator({callback:function(e){"down"==e.direction?clickArrow("bottom"):"up"==e.direction&&clickArrow("top")},preventMouse:!1})}function redirectNotFound(e){e=e?JSON.stringify(e):"",$.ajax({url:"/index.php",type:"POST",data:{data:"error",url:window.location.pathname,error:e},success:function(e){console.log("Страница не существует"),window.location.href=e}})}function backState(){document.referrer?window.location.href=document.referrer:window.location.href="/"}